import React, { useEffect } from "react";

import '../../normalize.scss';
import '../../base.scss';

import Console from '../../components/Cadastro/Consoles';
import View from "../view/view";
import { useHistory } from "react-router-dom";

function CadastroConsole(props) {
  const history = useHistory();
    const is_cadastro = props.history.location.state
    console.log(is_cadastro)

      useEffect(() => {
        if(is_cadastro === undefined || null) {
          history.push("/");
        }
        // eslint-disable-next-line
      },[]);
  return (
    <View cadastro={true}>
        <Console />
    </View>
  )
} 

export default CadastroConsole;
